import React from 'react';
import { Segment, Header } from 'semantic-ui-react';

const Launch = (props) => (
  <Segment>
    <Header>{props.name}</Header>
    <div>{props.rocket.name}</div>
    <div>{props.rocket.link}</div>
    <div>{props.agency.name}</div>
    <div>{props.agency.link}</div>
    <div>{props.location}</div>
    <div>{props.time}</div>
    {props.links.map((link,i) => (<div key={i}>{link}</div>))}
  </Segment>
)

export default Launch;
